INSERT INTO `static` (`static_id`, `page`, `details`) VALUES
(1, 'About Us', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#006666">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#006666">\r\n </font><h3 style="text-align: left;"><font color="#006666" face="Verdana, Geneva, sans-serif"><b>About Times2Jobs</b></font></h3><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2">Our career consultants Times2Jobs act as a career strategist and master of Achievement Based resume writing. Recognized as an expert in the field of resume writing.</font></div><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2">With a love for what we do our team of consultants are passionate about providing every customer with the ultimate first class-treatment and ensuring that their new resume will open doors and opportunities for their clients</font></div><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2">We wish to become the first online solution for resume writing &amp; distribution We are motivated by excellence, which demands we define a path of perpetual improvement. It also requires us to embrace change so our clients are always in the right place when new opportunities open up. Companies want to attract the best talent in the marketplace and we are committed to partnering with our clients to ensure that they have the tools to become top-shelf candidates. Their career search success is our unwavering ambition. We are continually tapping into new markets on the lookout for new technological trends that will put our clients one step ahead of their competitor</font></div><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><font color="#006666" face="times new roman" size="2">In the world of recruitment, it is essential that you market yourself in the best way possible to potential employers and stand out by looking as attractive a candidate as you can. It can be a daunting prospect, but Inspired CVs is here to help. We are a professional CV writing and consultancy service, and we know just how important it is to effectively market yourself. This is why we don?t limit our service to simply CV writing. Whether you need an eye-catching graphic CV, tailor written cover letters, LinkedIn profile design or even interview coaching, we can provide a package that meets your every need. Our highly experienced and dedicated team of employability experts guarantee that we can transform you from an everyday jobseeker into a polished, credible and employable candidate through our professionally written CVs, cover letters, and various other services, ensuring you?ll stand out from the crowd!</font></div><div><font color="#006666" face="Verdana, Geneva, sans-serif"><br></font></div><div style="color: rgb(153, 51, 0);"><br></div></font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
