fy;">You Represent And Warrant That You Are Competent And Eligible To Enter Into Legally Binding Agreement And Have The Requisite Authority To Bind&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>. To This Agreement. You Shall Not Use This Site If You Are Not Competent To Contract Under The Applicable Laws, Rules And Regulations.</div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;"><div>Term of Agreement/Service:</div><div><br></div><div>This Agreement Shall Continue To Be In Full Force And Effect For So Long As You Are Using&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>Services. Provides The Online Platform Wherein The Users Can Place Orders For Services Listed On www.<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>.com Pursuant To The Terms And Conditions Set Forth Below. Either You Or www.<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>.com May Terminate The Service At Any Time, With Or Without Cause. However www.<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>.com Reserves The Right, In Its Sole Discretion, To Terminate Your</div></div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;">Terms and conditions of Service:</div><div style="font-size: small;"><div style="text-align: justify;"><br></div><div style="text-align: justify;"><span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs</span><span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">&nbsp;</span>May At Any Time Modify The Terms And Conditions Of The Services Without Any Prior Notification To You. You Can Access The Latest Version Of The Terms, Which Shall Be Updated Regularly At The Link Our Website. You Undertake To Regularly Review The Terms. In The Event That The Modified Terms Are Not Acceptable To You, You Shall Immediately Discontinue Using The Services. However, If You Continue To Use The Services, You Hereby Agree To Accept And Be Bound By The Modified Terms. You Further Agree And Undertake That You Are Accessing The Services Available On This Site And Transacting At Your Sole Risk And Are Using Your Best And Prudent Judgment Before Entering Into Any Transaction Through This Site. All Orders Shall Be Pre-Approved With An Acceptable Method Of Payment As Available Through Payment Service Providers Connected With&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>, Which May Call For And Require Additional Verification Or Information.&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>Follows A Strict Verification Policy To&nbsp;Protect Your&nbsp;Interests And Avoid Fraudulent Transactions On The Site. You Agree To Provide Copies Of Your Credit Card, Statements Or Related Documents To Authenticate Your Transaction If Asked For. Any And All Orders Placed By You On This Site Are A Firm Commitment To Purchase And You Are Obligated To Complete The Transaction And Not Contest It In Anyway. Before Placing An Order You Are Advised To Check The Product Description Carefully. By Placing An Order For A Product You Agree To Be Bound &nbsp;By The Conditions Of Sale Included In The Items Description. By Submitting Your Details In The Form Of A Query Or An Order Or An Incomplete Order, You Agree To Become A Member or User And Receive Newsletters And Updates From&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>Unless Asked Not To By Writing To support@<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs</span>.com</div></div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;">Term of Agreement/Service:</div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;">This Agreement Shall Continue To Be In Full Force And Effect For So Long As You Are Using Resume2naukri Services. Provides The Online Platform Wherein The Users Can Place Orders For Services Listed On www.<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs</span>.com Pursuant To The Terms And Conditions Set Forth Below. Either You Or www.<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs</span>.com May Terminate The Service At Any Time, With Or Without Cause. However www.<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs</span>.com Reserves The Right, In Its Sole Discretion, To Terminate Your Credit card details You Agree Understand And Confirm That The Credit Card Details Provided By You For Availing Of Services On&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>Will Be Correct And Accurate And You Shall Not Use&nbsp;The Credit Card Which Is Not Lawfully Owned By You. You Further Agree And Undertake To Provide The Correct And Valid Credit Card Details To Payment Gateway. Further The Said Information Will Be Not Being Utilized And Shared By Us With Any Of The Third Parties Unless Required By Law, Regulation Or Court Order.</div></div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;"><div>Credit card details</div><div><br></div><div>You Agree Understand And Confirm That The Credit Card Details Provided By You For Availing Of Services On&nbsp;<span style="color: rgb(0, 102, 102); font-family: ''times new roman'';">Times2Jobs&nbsp;</span>Will Be Correct And Accurate And You Shall Not&nbsp;Use The Credit Card Which Is Not Lawfully Owned By You. You Further Agree And Undertake To Provide The Correct And Valid Credit Card Details To Payment Gateway.&nbsp;Further The Said Information Will Be Not Being Utilized And Shared By Us With Any Of The Third Parties Unless Required By Law, Regulation Or Court Order.</div></div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;">Cancellation / Refund Policy:</div><div style="font-size: small; text-align: justify;"><br></div><div style="font-size: small; text-align: justify;">Please Note That There May Be Certain Orders That We Are Unable To Process And Must Cancel Even If Approved. We Reserve The Right, At Our Sole Discretion, To Refuse Or Cancel Any Order For Any Reason. Some Situations That May Result In Your Order Being Cancelled Include Inaccuracies Or Errors In Service Pricing Information, Or Problems Identified By Our Credit And Fraud Avoidance Department. We Will Contact You If Your Order Is Canceled Or If Additional Information Is Required To Accept Your Order. Any Refund/Cancellation request will be entertained within 24 Hours of placing the order, however post 24hours we will rework on your service In Case We Are Not Able To Process Your Order &nbsp;Refunds are not being provided for products that have already been approved by the customer. Refunds are being processed with in 90 Working Days.</div><div style="font-size: small; text-align: justify;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;If Your Order Is Cancelled After The Payment Was Made By Credit Card Or Net-Banking, We Will Refund The Credit Card Or Net-Banking Account. If The Payment Mode Was Cheque, We Will Send You A Cheque Or Do An NEFT Transfer Is Possible With Your Bank. Cheque Will Be Sent Only To The Billing Address Of The Customer. In Case We Receive A Cancellation Notice From The Customer And The Order Has Not Been Processed/ Approved By Us, We Shall Cancel The Order And Refund The 100% Of The Amount. If The Order Has Been Processed Or Delivered, We Will Refund 25% Of The Order Amount If Provided By Justifiable Reasons. There May Be Few Cases Where The Orders Are Not Delivered In Time, As A Customer You Have The Right To Ask For A 100% Refund Or The Order Completion. If Refund Option Is Chosen, The Product May Or May Not Be Delivered At The Sole Discretion Of Resume2naukri. However, In Case Of Any Defamatory Remarks Posted Anywhere, Reserves The Right To Stop The Refund And The Order And Initiate A Lawsuit For Defamation.</div></div><div style="text-align: justify;"><font color="#006600" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><font color="#006600" face="times new roman" size="2">Shipping Policy:</font></div><div style="text-align: justify;"><font color="#006600" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><font color="#006600" face="times new roman" size="2">All Orders Will Be Delivered As An Attachment In Emails In Microsoft Word Format To The Email ID Provided At The Time Of Placing An Order.</font></div></div><div style="text-align: justify;"><font color="#006600" face="times new roman" size="2"><br></font></div><font style="font-family: Verdana, Geneva, sans-serif; color: rgb(153, 51, 0);">\r\n </font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
(4, 'PrivacyAndPolicy', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font>\r\n <font>\r\n <font>\r\n <font><font color="#993300" size="2" face="times new roman" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><b>\r\n </b></font><font><font color="#993300" size="2" face="times new roman" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><b>\r\n </b></font><font><font color="#993300" size="2" face="times new roman" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><b>\r\n </b></font><font><font color="#993300" size="2" face="times new roman" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><b>\r\n </b></font><h2 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><font face="times new roman" color="#006600" size="4">Privacy Policy</font></h2><h3 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify;"><font size="2" face="times new roman" color="#006600" style="font-weight: normal;">Your privacy is important to us. To better protect your privacy we provide this notice explaining our online information practices and the choices you can make about the way your information is collected and used. To make this notice easy to find, we make it available on our homepage and at every point where personally identifiable information may be requested. What information do we collect? We collect information from you when you register on our site, place an order or subscribe to our newsletter. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address or phone number. You may, however, visit our site anonymously.</font></h3><h3 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify;"><font size="2" face="times new roman" color="#006600" style="font-weight: normal;">Access or change your Personal Information</font></h3><h3 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify;"><font size="2" face="times new roman" color="#006600" style="font-weight: normal;">You may review, correct, update or change your account information at any time.</font></h3><h3 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify;"><font size="2" face="times new roman" color="#006600" style="font-weight: normal;">To protect your privacy and security, we will verify your identity before granting access or making changes to your Personal Information. If you have registered your profile on the Website, your ID and Password are required in order to access your Account.</font></h3><h3 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify;"><font size="2" face="times new roman" color="#006600" style="font-weight: normal;">Disclaimer</font></h3><h3 style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify;"><font size="2" face="times new roman" color="#006600" style="font-weight: normal;">The Company does not access, store or keep credit card data. All credit card transactions happen through third party gateways and the Company plays no role in the transaction, except for directing the customers to gateways or relevant webpage. Accordingly, the Company shall not be responsible or liable for any loss or damage due to any disclosure whatsoever of Personal Information.</font></h3><div><font size="2" face="times new roman" color="#006600"><div>Online Privacy Policy Only:</div><div><br></div><div>This online privacy policy applies only to information collected through our website and not to information collected offline.</div><div><br></div><div>Your Consent:</div><div><br></div><div>By using our site, you consent to our web site privacy policy.</div></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#006600"><div><br></div><div>Changes to our Privacy Policy</div><div><br></div><div>The contents of this statement may be altered at any time, at our discretion.If there is any update on our privacy policy. Please check our privacy policy periodically for changes. We will also notify you of significant updates and will post the date it was last updated at the bottom of the privacy policy.</div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><br></div></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><font color="#993300" size="2" face="times new roman"><br></font></div><font style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;">\r\n </font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font></font></font></font></font>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
