(14, 'SocialMediaProfile', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font size="2" face="times new roman" style="font-family: Verdana, Geneva, sans-serif;" color="#000033">\r\n </font><font><font size="2" face="times new roman" style="font-family: Verdana, Geneva, sans-serif;" color="#000033">\r\n </font><font><font size="2" face="times new roman" style="font-family: Verdana, Geneva, sans-serif;" color="#000033">\r\n </font><font><font><div style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033"><u><br></u></font></div><h2><font face="times new roman" size="4" color="#000033"><u>Social Media Profile</u></font></h2><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font face="times new roman" size="2" color="#000033">Social Profiler is a Professional and personalized Social media profile writing service that endeavors to provide you a strong and accurate presence on popular professional Social networking Websites such as Linkedin.</font></div><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font face="times new roman" size="2" color="#000033"><br></font></div><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#000033">Herein we understand your profile, your aspirations and deliver a professional + comprehensive write-up. This is crafted as per your Resume and engaging telephonic discussions conducted by us.</font></div><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman"><div style="text-align: justify;"><font color="#000033">Our writers with the right knowledge and know-how of social media and with 10 years of profile writing experience crafts your Social Media Profile</font></div><div style="text-align: justify;"><font color="#000033">It is a personalized social profile-writing service delivered by the very best and experienced resume writing experts. that endeavors to gets you noticed by the people who matter and help you take the next step of the career ladder.</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033">We build you a strong professional identity online We help you turn your mere presence on any social media into an interactive dialogue between you and the organizations, communities, and individuals. Build your own ideology on present technology and make a difference like never before. With this close network, you can not afford to remain oblivious to the fact that you are ubiquitous. Yes, you are ubiquitous!</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div><br></div></font></div></font></font>\r\n\r\n</font>\r\n\r\n</font></font></font></font></font></font></font></font></font></font></font></font></font></font>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</font>\r\n\r\n'),
(15, 'JobSeeker', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font><font size="2" face="times new roman" color="#000033">\r\n </font><font><font size="2" face="times new roman" color="#000033">\r\n </font><font><font size="2" face="times new roman" color="#000033">\r\n </font><font><font size="2" face="times new roman" color="#000033">\r\n </font><font><font size="2" face="times new roman" color="#000033">\r\n </font><font><font size="2" face="times new roman"><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><h2><font color="#000033"><u>Job Hunting and Sharing</u></font></h2><div style="text-align: justify;"><font color="#000033">Stay updated on all current and relevant job openings! Our experienced staff personally update you with all new jobs out in the market.</font></div><div style="text-align: justify;"><font color="#000033">Our trained career consultants will search job on your behalf.These professionals will get in touch with the latest job openings and will help you to connect with these jobs instantly.</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033">How soon would the Relationship Manager call me ?</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033">Relationship Manager will get in touch with you within 72 working hours of Order Activation. Relationship Manager will take your profile information and job preferences details in order to initiate your JobSeeker.</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033">How can I get in touch with the Relationship Manager?</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033">You can write your concerns or issues to your Relationship Manager or on Support@Resume2naukri.com . Your relationship Manager will get in touch with you through mail or call, as per the requirement.</font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="text-align: justify;"><font color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); text-align: justify;"><font><br></font></div></font></font>\r\n\r\n</font>\r\n\r\n</font></font></font></font></font></font></font></font></font></font></font></font>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</font>\r\n\r\n'),
(16, 'InterviewPreparation', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font><font face="times new roman" size="2" color="#000033">\r\n </font><font><font face="times new roman"><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><div><h2><font size="4" color="#000033"><u>Interview Preparation</u></font></h2><div style="font-size: small;"><font color="#000033">Behavior-based interviewing is an approach that looks at past behavior as a predictor of future performance. This type of interview allows the interviewer to evaluate a candidates experiences and behaviors in order to determine the applicants potential for success. The following list of sample interview questions will assist in identifying job-related experiences, behaviors, knowledge, skills and abilities.</font></div><div style="font-size: small;"><font color="#000033"><br></font></div><div style="font-size: small;"><font color="#000033">Every job seeker aspires to get selected for a job of his / her choice. But not everybody is successful. The candidate is under the scrutiny of the interviewer right from the time of entry into the room. We are providing you the important tips which will help you in facing the interview panel.</font></div><div style="font-size: small;"><font color="#000033"><br></font></div><div style="font-size: small;"><font color="#000033">Interviewing is a skill you can learn. With the right tips and techniques, you can become a master at sharing your value with potential employers, presenting yourself effectively at interviews, and getting the job you want.</font></div><div style="font-size: small;"><font color="#000033"><br></font></div><div style="font-size: small;"><font color="#000033">In every interview the interviewer is basically looking for one specific thing in the applicant or the candidate, Can this candidate get the work done and achieve the results I need? A job profile is drawn up by determining what tasks and responsibilities comprise the job and what knowledge, skills and abilities( are required by the successful candidate to achieve these</font></div></div><div style="font-size: small;"><font color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); font-size: small;"><br></div></font></font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
(17, 'Career&FinanceReport', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><div><font face="Verdana, Geneva, sans-serif" color="#000033">&nbsp;</font></div><h2><font face="times new roman" size="4" color="#000033"><u>Report Summary</u>:&nbsp;</font></h2><div><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033">This document provides a thematic review and meta-analysis of general and disability-related literature in order to identify interrelationships between disability and job retention/career progression for Canadian working people. It develops four broad groups of macro- and micro-level variables that are considered in the literature to be strongly related to how employment histories evolve. The review provides direction for the development of a series of research questions addressing gaps in our understanding in this area.&nbsp;</font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033">Once you are through with the studies in your own chosen stream, it becomes essential to find a good job within your own stream and then set the goals subsequently. Going forward we strive to get the job and once attained, we try to work to the best of our abilities. However, sometimes the returns of our efforts do not occur as per our expectations and we end up getting dissatisfied and disheartened.</font></div><div style="color: rgb(153, 51, 0); text-align: justify;"><font color="#993300" face="Verdana, Geneva, sans-serif"><br></font></div></font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
(18, 'JobChangePlanning', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="color: rgb(153, 51, 0);"><font face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><font><font color="#000033" face="times new roman">\r\n </font><div><font><font><font color="#000033" face="times new roman"><br></font></font></font></div><h2><font><font><font><font size="4" color="#000033" face="times new roman"><u>\r\n Job Change Planning</u></font></font></font></font></h2><div style="text-align: justify;"><font><font><font><font size="2" color="#000033" face="times new roman"><br></font></font></font></font></div><div><font><font><font><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman">Many organizations trying to cut costs and become more efficient are simply cutting jobs. The more innovative companies,&nbsp;however, are not just&nbsp;reducing their workforces. They are changing the ways employees work. They are moving away from work divided among specific functions (jobs) to work based on teams and projects. Teams of employees, and perhaps independent contractors,come together to build a new product, much like&nbsp;neighbors in farm towns came together to put up a barn. When the product is finished, the team breaks u</font></div><div><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman"><br></font></div><div style="text-align: justify;"><font color="#000033" face="times new roman"><b>Benifits</b></font></div><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman"><br></font></div><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman">Right Time to switch your job.</font></div><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman">Future for another company</font></div><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman">Best Result you get for new company</font></div><div style="text-align: justify;"><font size="2" color="#000033" face="times new roman">Ways to improve your overall career</font></div><div style="text-align: justify; font-size: small;"><font color="#000033" face="times new roman"><br></font></div><div style="font-size: small;"><font face="Verdana, Geneva, sans-serif"><br></font></div></div></font></font></font></div></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</font>\r\n\r\n'),
(19, 'EducationVarification', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font style="font-family: Verdana, Geneva, sans-serif;" color="#000033" face="Verdana, Geneva, sans-serif">\r\n </font><font><font><font><h2><font color="#000033" face="times new roman" size="4"><u>Education Verfication</u></font></h2><div><font color="#000033" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2">Get your highest Education </font><font style="font-family:Verdana, Geneva, sans-serif; color:#930;"><font style="font-family:Verdana, Geneva, sans-serif; color:#930;"><font style="font-family:Verdana, Geneva, sans-serif; color:#930;"><font style="font-family: Verdana, Geneva, sans-serif;"><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033" face="times new roman" size="2">Verification</font></font></font></font></font></font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2">Get increased trust by recruiters on your educational experience</font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2">Enhance Self-confidence</font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" siz