gn: justify;"><font color="#000033" face="times new roman" size="2">An exclusive service that gets your professional experience in prior to previous employment accredited.</font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2">A verified profile always gets an advantage over an unverified profile and will help you gain recruiters trust.</font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2">These verification services are offered by certified verification agencies that deliver a verification report once the process is completed at their end</font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2">The same verification reports can also be viewed by companies and recruiters&nbsp;</font></div><div style="text-align: justify;"><font color="#000033" face="times new roman" size="2"><br></font></div><div style="text-align: justify;"><img src="http://i.imgur.com/c3v5jFD.jpg" width="300"></div><div><font color="#000033" face="times new roman" size="2"><br></font></div><div style="color: rgb(153, 51, 0);"><font color="#006600" face="times new roman" size="2"><br></font></div></font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n');
