(21, 'BothVarification', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><h2><font color="#000033" face="times new roman" size="4"><u>Education and Employee Verfication</u></font></h2><h2><img src="http://i.imgur.com/WSMFAuV.jpg" style="text-align: justify;" width="250"></h2><div style="text-align: justify;"><h2 style="text-align: start;"><div style="font-size: medium; font-weight: normal; text-align: justify;"><div><font color="#000033" face="times new roman" size="2">Get your </font><font style="font-family:Verdana, Geneva, sans-serif; color:#930;"><font style="font-family:Verdana, Geneva, sans-serif; color:#930;"><font style="font-family:Verdana, Geneva, sans-serif; color:#930;"><font style="font-family: Verdana, Geneva, sans-serif;"><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033" face="times new roman" size="2">Employee + Education Verification </font></font></font></font></font></font></div><div><font color="#000033" face="times new roman" size="2">Get increased trust by recruiters on your educational experience</font></div><div><font color="#000033" face="times new roman" size="2">Enhance Self-confidence</font></div><div><font color="#000033" face="times new roman" size="2">Increase your chances of getting more interview calls</font></div><div><font color="#000033" face="times new roman" size="2">An exclusive service that gets your topmost educational qualification accredited.</font></div><div><font color="#000033" face="times new roman" size="2">An exclusive service that gets your professional experience in prior to previous employment accredited.</font></div><div><font color="#000033" face="times new roman" size="2">A verified profile always gets an advantage over an unverified profile and will help you gain recruiters trust.</font></div><div><font color="#000033" face="times new roman" size="2">These verification services are offered by certified verification agencies that deliver a verification report once the process is completed at their end</font></div><div><font color="#000033" face="times new roman" size="2">The same verification reports can also be viewed by companies and recruiters&nbsp;</font></div><div><br></div></div></h2></div></font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
(22, 'GrowthPack', '<font style="font-family: Verdana, Geneva, sans-serif; ">\r\n <font>\r\n <font style="font-family: Verdana, Geneva, sans-serif; color: rgb(153, 51, 0); "><u>\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n <font style="font-family: Verdana, Geneva, sans-serif;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;">\r\n </font></font></font></font><div><br></div><font><font><font><font><font color="#000033"><font><font><font><font><font><font size="2" face="times new roman"><font><font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></font></u></font><h2><font face="times new roman" size="4" color="#000066"><u>Growth Summary</u></font></h2><div style="font-family: Verdana, Geneva, sans-serif; "><span style="font-size: small; text-align: justify; "><font color="#000066">Through our Job Portal our registered candidates will receive Job Alerts by subscribing to jobs for desired categories. Once they subscribe, they will receive emails whenever new jobs are posted in the categories they subscribe from this job alert, which will also enable them to send their application for the same.</font></span></div><font size="2" face="times new roman" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; "><div style="text-align: justify;"><br></div></font><div style="font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font><font size="2" face="times new roman" color="#000066">A resume that worked wonders for your friend might not necessarily work for you. So, having a resume made exclusively to suit your needs will give that added advantage in your extensive job hunt. &nbsp;By taking our two services in a single pack you will get benefit in terms of your career as well as monetarily i.e. less payment of money and double the chance of getting an interview calls.</font></font></div><div style="font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font><font size="2" face="times new roman" color="#000066"><br></font></font></div><div style="font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000066"><font>Your resume is your personal advertisement to the recruiter.</font><font>You should avail Resume Critique service to know if your Resume is up to the mark and has all&nbsp;</font>the vital components required to grab recruiters attention.&nbsp;You can benefit from the resume tips (given by resume experts after analyzing your resume), and make your resume an invincible tool for job hunt.</font></div><div style="font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000066"><br></font></div><div style="font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font><font size="2" face="times new roman" color="#000066">At a glance, things that may get your resume picked are right structure, crisp information, relevant information and highlighted crucial aspects.</font></font></div><div style="color: rgb(153, 51, 0); text-align: justify; font-family: Verdana, Geneva, sans-serif; "><font><font face="Verdana, Geneva, sans-serif" color="#000033"><br></font></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; "><font><font color="#993300" face="Verdana, Geneva, sans-serif"><br></font></font></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
(6, 'ResumeForwardIndia', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font><font style="font-family: Verdana, Geneva, sans-serif;" color="#000033">\r\n </font><div><font size="2" face="times new roman" color="#000033"><br></font></div><h2><font color="#000033" size="4"><u><font face="times new roman">Increase your chance of geeting job</font><font face="times new roman">&nbsp;</font></u></font></h2><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033">You now have an easy access to top recruitment consultants in India through Resume Forward- our resume distribution service.</font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033">Resume Forward India brings a complete universe of job opportunities. Our attractive package connects you with top consultants nationally and globally. Our premier network of consultants offers most desirable opportunities at the first go.</font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033">Resume Forward India is the perfect blend that helps you create global network when your resume is sent to placement consultants as well as you get the notification on your registered mobile phone and email address, both. Have you ever imagined staying connected so actively while searching jobs?</font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033">We ensure you are the first to be seen by recruiters in their search for candidates matching your profile</font></div><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><font>Get increased visiblity&nbsp;</font>Apply to jobs not Publish on job portal.</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif;"><font color="#006600"><span style="font-family: Verdana, Geneva, sans-serif;"><br></span></font></div>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
