(9, 'ResumeWritingIndia', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font>\r\n <font><font color="#000033" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; ">\r\n </font><font><font color="#000033" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; ">\r\n </font><font><font color="#000033" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; ">\r\n </font><font><font size="2" face="times new roman" color="#000033" style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; ">\r\n </font><h2 style="color: rgb(153, 51, 0); "><font size="2" face="times new roman" color="#000033" style="font-family: Verdana, Geneva, sans-serif; ">&nbsp;</font><font face="times new roman" color="#000033" size="4"><u>Resume Writing India</u></font></h2><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Making a positive 1st impression on recruiters Your career is just getting started. You need to make the most of the international jobs opportunities from day one. With little or no experience of the recruitment process, you are likely to make simple resume mistakes and reduce your chances of getting shortlisted.&nbsp;</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Are you one of those Job seekers who have been sending far too many resumes and been hit with far too many disappointment? The problem may not lie with your qualification or skills set. Employer filters tons of resumes on daily basis, only the outstanding ones get noticed Our professional resume writers will deliver the Resume that you need to make your case, by highlighting the benefits of your recently completed education &nbsp;</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033"><b><br></b></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033"><b>Resume Importants</b>:</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Your skills and education are highlighted with industry key words.</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Showcasing your strengths, abilities and motivation</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Your career objective are clearly articulated.</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Understanding your aspirations</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify; "><font size="2" face="times new roman" color="#000033">Resume is formatted and designed as per latest industry trends.</font></div><div style="color: rgb(153, 51, 0); font-family: Verdana, Geneva, sans-serif; text-align: justify