(11, 'ResumeWritingBoth', '<font style="font-family: Verdana, Geneva, sans-serif; "><font style="font-family: Verdana, Geneva, sans-serif; "><font style="font-family: Verdana, Geneva, sans-serif; "><h2 style="color: rgb(153, 51, 0); "><font face="times new roman" color="#000033" size="4"><u>Resume Writing Both</u></font></h2><div style="color: rgb(153, 51, 0); "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Making a positive 1st impression on recruiters Your career is just getting started. You need to make the most of the international jobs opportunities from day one. With little or no experience of the recruitment process, you are likely to make simple resume mistakes and reduce your chances of getting shortlisted.&nbsp;</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Are you one of those Job seekers who have been sending far too many resumes and been hit with far too many disappointment? The problem may not lie with your qualification or skills set. Employer filters tons of resumes on daily basis, only the outstanding ones get noticed Our professional resume writers will deliver the Resume that you need to make your case, by highlighting the benefits of your recently completed education &nbsp;</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033"><b><br></b></font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033"><b>Resume Importants</b>:</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Your skills and education are highlighted with industry key words.</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Showcasing your strengths, abilities and motivation</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Your career objective are clearly articulated.</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Understanding your aspirations</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Resume is formatted and designed as per latest industry trends.</font></div><div style="color: rgb(153, 51, 0); text-align: justify; "><font size="2" face="times new roman" color="#000033">Assessing your career objective via telephonic discussion&nbsp;</font></div><div style="color: rgb(153, 51, 0); "><font size="2" face="times new roman" color="#000033"><br></font></div><br class="Apple-interchange-newline"><div style="color: rgb(153, 51, 0); "><font style="font-family: Verdana, Geneva, sans-serif;"><div style="text-align: justify;"><font size="2" face="times new roman" color="#000033"><br></font></div><div><font size="2" face="times new roman" color="#006600"><br></font></div></font></div></font>\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
(12, 'CoverLetterIndia', '<font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family:Verdana, Geneva, sans-serif; color:#930;">\r\n <font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font style="font-family: Verdana, Geneva, sans-serif;"><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font color="#000033">\r\n </font><font><font face="Verdana, Geneva, sans-serif" style="font-family: Verdana, Geneva, sans-serif;" color="#000033">\r\n </font><font><div style="font-family: Verdana, Geneva, sans-serif;"><font face="Verdana, Geneva, sans-serif" color="#000033"><br></font></div><h2><font face="times new roman" size="4" color="#000033"><b><u>Cover Letter India</u></b></font></h2><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#000033"><font>Many people think that it is ok to send a resume without a cover letter india.&nbsp;</font>Well for those here is a fact. Unless you like to send your resume into other peoples trash. There exist very simple yet important things which could take your resume to a different or the term should be desired level altogether.</font></div><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#000033">At a glance, things that may get your resume picked are right structure, crisp information, relevant information and highlighted crucial aspectscans, make sure that a cover letter india companies your resume. It does not merely introduce your resume but entices the &nbsp;employer to look for it. Your resume talks about you, your cover letter india talks about your intended employer - and how your employer can benefit from the splendid assets you offer. Describe special benefits that set you above other applicants. So make sure that you get have yourself covered with a cover letter india before sending out your resume</font></div><div style="text-align: justify; font-family: Verdana, Geneva, sans-serif;"><font size="2" face="times new roman" color="#000033"><br></font></div><div style="font-family: Verdana, Geneva, sans-serif;"><div style="text-align: justify; "><font size="2" face="times new roman" color="#000033">Detailed analysis of your entire resume, highlighting it is strengths and weaknesses.</font></div><div style="text-align: justify; "><font size="2" face="times new roman" color="#000033">Detailed steps to highlight resumes strength, and shortcomings which need to be improved.</font></div><div style="text-align: justify; "><font size="2" face="times new roman" color="#000033"><br></font></div><div style="text-align: justify; "><font size="2" face="times new roman" color="#000033">Exact measures on what and how you need to do to improve on your resume</font></div></div><div style="color: rgb(153, 51, 0); text-align: justify; font-family: Verdana, Geneva, sans-serif;"><br></div></font></font></font></font></font></font></font></font></font></font></font></font>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</font>\r\n\r\n</font>\r\n\r\n'),
